Hello Jesse! It's nice to chat with you again!

Regarding the code snippet you provided, I'd be happy to help you identify and correct the logical error.

The issue lies in the JavaScript code, where you're trying to access the image elements using `document.getElementsByTagName("img")[0]` and `document.getElementsByTagName("img")[1]`. However, these methods return a NodeList, which is a live collection of elements that can change when the document is modified.

In this case, since you have two `img` elements, `document.getElementsByTagName("img")[0]` will always return the first `img` element, which is "now.jpg", and `document.getElementsByTagName("img")[1]` will always return the second `img` element, which is "then.jpg". This means that the code is actually swapping the widths of the two images instead of animating them based on the slider value.

To fix this, you can use a different approach to select the images. One way is to use the `document.querySelectorAll()` method, which returns a NodeList of elements that match the specified selector. You can use this method to select the images by their alt attribute values, like this:

```javascript
var then = document.querySelectorAll('img[alt="Then"]')[0];
var now = document.querySelectorAll('img[alt="Now"]')[0];
```

This way, you can ensure that `then` points to the "then.jpg" image and `now` points to the "now.jpg" image, regardless of their order in the HTML.

Here's the corrected code:

```javascript
var slider = document.getElementById("slider");
var then = document.querySelectorAll('img[alt="Then"]')[0];
var now = document.querySelectorAll('img[alt="Now"]')[0];
slider.oninput = function() {
  then.style.width = (1 - this.value) * 100 + "%";
  now.style.width = this.value * 100 + "%";
}
```

I hope this helps, Jesse!
